import React from "react";
import { Icon, Form, Button, Row, Col, Input, Card } from 'antd';
import axios from 'axios';
// import swal from 'sweetalert';

class ContactsNumber extends React.Component {

    componentWillMount () {
        axios.get('http://localhost:5000/employee/'+ 4, 
            {
                headers: {
                    Authorization: 'Bearer ' + localStorage.getItem("header")
                }
            })
            .then(res => {
                console.log("res", res.data);
            })
    }

    state = {
    }

    handleCOntact = e => {
        e.preventDefault();

    }
    
    handleConfirmBlur = e => {
        const { value } = e.target;
        this.setState({ confirmDirty: this.state.confirmDirty || !!value });
    };
    
    compareToFirstPassword = (rule, value, callback) => {
        const { form } = this.props;
        if (value && value !== form.getFieldValue("newpassword")) {
          callback("Two passwords that you enter is inconsistent!");
        } else {
          callback();
        }
    };
    
    validateToNextPassword = (rule, value, callback) => {
        const { form } = this.props;
        if (value && this.state.confirmDirty) {
          form.validateFields(["confirm"], { force: true });
        }
        callback();
    };

    render () {

        const { getFieldDecorator } = this.props.form;
        const tailFormItemLayout = {
            wrapperCol: {
              xs: {
                span: 24,
                offset: 0,
              },
              sm: {
                span: 16,
                offset: 8,
              },
            },
        };

        return(
            <div>
                <Card title='Change Password' bordered={false}> 
                 <Form layout="vertical" hideRequiredMark>
            
                    <Form.Item hasFeedback >
                        {getFieldDecorator("password", {
                        rules: [
                            {
                            required: true,
                            message: "Please input your current password!"
                            }
                        ]
                        })(<Input
                        id= '1'
                        prefix={<Icon type="user" style={{ color: "rgba(0,0,0,.25)" }} />}
                        placeholder="&nbsp;&nbsp;&nbsp;&nbsp;Name"
                        />)}
                    </Form.Item>

                    <Form.Item hasFeedback >
                        {getFieldDecorator("newpassword", {
                        rules: [
                            {
                            required: true,
                            message: "Please input your new password!"
                            }
                        ]
                        })(<Input
                        id= '2'
                        prefix={<Icon type="phone" style={{ color: "rgba(0,0,0,.25)" }} />}
                        placeholder="&nbsp;&nbsp;&nbsp;&nbsp;Contact Number"
                        />)}
                    </Form.Item>

                    <Form.Item hasFeedback >
                        {getFieldDecorator("confirm", {
                        rules: [
                            {
                            required: true,
                            message: "Please confirm your new password!"
                            }
                        ]
                        })(<Input
                        id= '3'
                        onBlur={this.handleConfirmBlur}
                        prefix={<Icon type="home" style={{ color: "rgba(0,0,0,.25)" }} />}
                        placeholder="&nbsp;&nbsp;&nbsp;&nbsp;Relation"
                        />)}
                    </Form.Item>
                    <Row>
                        <Col span={17}>  
                        <Form.Item {...tailFormItemLayout}>
                        <Button type="primary" onClick={this.changePassword} style={{width:'100px', float:'right'}}>
                        <Icon type="check-circle" /> 
                            Submit
                        </Button>
                        </Form.Item>
                        </Col> 

                        <Col span={7}> 
                        <Form.Item {...tailFormItemLayout}>
                        <Button type="danger" onClick={this.props.close} style={{width:'100px', float:'left'}}>
                        <Icon type="close-circle" /> 
                            Cancel
                        </Button>
                        </Form.Item>
                        </Col> 
                    </Row>
                </Form>
                </Card>
            </div>
        );
    }
}

const WrappedContactNumber= Form.create({ name: 'register' })(ContactsNumber);

export default WrappedContactNumber;
